// * {
//   box-sizing: border-box;
// }
html {
  // font-size: 100% = 25.60
  font-size: 62.5%;
  font-family: $fontFamily, sans-serif;
  // @include to(250px) {
  //   font-size: 30%;
  // }
  // height: 100%;
  min-height: 100vh;
  // overflow-x: hidden;
  -webkit-tap-highlight-color: transparent;
  scroll-behavior: smooth;
}
body {
  -webkit-overflow-scrolling: touch;
  overflow-y: auto;

  font-weight: 500;
  // line-height: 1.5;
  line-height: initial;
  @include t-(gray-dark);
  text-align: left;
  // line-break: auto;
  font-size: $font-size;
  // background-color: $white;
  // smooth transition--------
  // transition: background 500ms ease-in-out, color 1000ms ease-in-out;
  transition: color 1000ms ease-in-out;

  -webkit-background-size: cover;
  -moz-background-size: cover;
  -o-background-size: cover;
  background-size: cover;

  // Disable Mobile Webkit Highlights */
  // -webkit-touch-callout: none;
  // -webkit-user-select: none;
  // -khtml-user-select: none;
  // -moz-user-select: none;
  // -ms-user-select: none;
  // user-select: none;
}

*,
*::after,
*::before {
  padding: 0;
  margin: 0;
  outline: 0px solid;
  // box-sizing: border-box;
}

*:hover,
*:active,
*:focus,
*:visited,
*::after:hover,
*::after:active,
*::after:focus,
*::after:visited,
*::before:hover,
*::before:active,
*::before:focus,
*::before:visited {
  outline: 0px solid;
}

img {
  border: 0;
  max-width: 100%;
  // max-height: 100%;
  vertical-align: middle;
  display: inline-block;
  object-fit: cover;
}
button {
  color: inherit;
}
table {
  border-collapse: collapse;
  width: 100%;
  // margin-bottom: 10rem;
  overflow-x: auto;
  border-spacing: 0;
  display: table;

  & td,
  & th,
  & {
    padding: Div($padding, 2);
    // vertical-align: top;
    // border-bottom: 1px solid #dee2e6;
    // border: 2px solid #dee2e6; // all bordered
  }
  & th {
    text-align: center;
    font-weight: $bold;
    // background-color: rgb(231, 231, 231);
  }
  & caption {
    font-weight: $italic;
    font-size: $font-size;
  }
  &.odd tr:nth-child(odd) {
    // background: #dae5f4;
    @include bg-(primary-light);
  }
  &.even tr:nth-child(even) {
    // background: #dae5f4;
    @include bg-(primary-light);
  }
  // & tbody {
  // }
  // & thead {
  // }
}

hr {
  // border-style: solid;
  margin-top: $margin;
  border-top: none;
  border-left: none;
  border-right: none;
  border-bottom: 1px solid Color(gray-light);
}

//==========================tips==========================//
//  Define the background color for all the ODD background rows  */
// tr:nth-child(odd) {
//   background: #dae5f4;
// }
//  Define the background color for all the EVEN background rows  */
//  tr:nth-child(even){
//   background: #dae5f4;
// }

//-------------------progress----------------------------------//
progress {
  // vertical-align: baseline;
  width: 100%;
  background-color: rgba(255, 255, 255, 0);

  // &::-webkit-progress-bar {
  //   // background-color: $gray-light;
  //   border-radius: 20px;
  // }
  // &::-moz-progress-bar {
  //   // background-color: $gray-light;
  //   border-radius: 20px;
  // }

  // @include placeholder(progress-bar) {
  //   background-color: var(--primary-dark);
  //   border-radius: 20px;
  // }
}
.progress {
  height: 16px;
  background-color: $gray-light;
  display: flex;
  & *:not(div) {
    justify-self: center;
    align-self: center;
  }
  & > div {
    height: 100%;
  }
}

//-------------------------------------------//
// global variables, from bootstrap
:root {
  // colors ---------------------------------
  @each $key, $value in $colors {
    --#{"" +$key}: #{$value};
  }
}

:root {
  --z-back: -10;
  --z-normal: 1;
  --z-tooltip: 10;
  --z-fixed: 100;
  --z-modal: 1000;
}

//------------------Interpuncts----------------------------------*/
.list-interpunct > li::before {
  content: "・";
  display: inline-block;
  // float: left;
  margin: 0 0 0 -0.9em;
  width: 0.9em;
}

@media (min-width: 992px) {
  .list-interpunct > li::before {
    margin: 0 0 0 -1.5em;
    width: 1.5em;
  }
}

@each $key, $index in $zIndexs {
  .z-#{"" + $key} {
    z-index: $index;
  }
}

// https://fonts.google.com/ */
@import url($importFont);

@if $importFont2 != none {
  @import url($importFont2);
}

strong {
  font-weight: 700;
}

// ----------------------------
h1,
h2,
h3,
h4,
h5,
h6 {
  // margin-bottom: 0.5rem;
  font-weight: 500;
  // color: var(--title-color);
  // line-height: 1.2;
}

h1 {
  font-weight: bold;
  font-size: $title; // 2.5rem
}

h2 {
  font-size: $title - 0.5;
}

h3 {
  font-size: $title - 0.75;
}

h4 {
  font-size: $title - 1;
}

h5 {
  font-size: $title - 1.25;
}

h6 {
  font-size: $title - 1.5;
}

//  font 2
.font2 {
  @if $font2 != none {
    font-family: $font2;
  }
}

//-------------------selection----------------------------------//
::selection {
  background: $selection-bg;
  color: $selection-color;
}
::-moz-selection {
  background: $selection-bg;
  color: $selection-color;
}
::-webkit-selection {
  background: $selection-bg;
  color: $selection-color;
}

//-------------------links----------------------------------//
a {
  text-decoration: none;
  color: inherit;
  outline: none;
  cursor: pointer;

  &:focus {
    outline: 0;
  }
}
.a {
  color: $link;
  color: var(--link);
  @extend a;
  &:link {
    color: $link;
  }
  &:visited {
    color: darken($link, $lighten);
  }
  &:hover {
    color: lighten($link, 40%);
  }
  &:active {
    color: darken($link, $darken);
  }
}
//-----------------------------------------------------//

// ol ol,
// ol ul,
// ul ol,
// ul ul {
//   margin-left: 2rem;
// }
.ol,
.ol,
.ul {
  padding-left: 0 $padding * 2;
}
// ol,
// ol,
