@use "sass:math";
@import "0_reset/minireset.scss";

@import "defaultVariables.scss";

// //==========================custome variables==========================*/
@import "variables.scss";
// //==========================================================*/
// @import "settings";
// @import "layout";
// @import "utilities";
// ------------------------
@import "settings/maps";
@import "settings/functions";
@import "settings/mixins";

@import "base";
// @import "settings/base";
@import "settings/forms";
@import "settings/dark-mode";
@import "settings/buttons";
@import "settings/toggles";

// ------------------------
@import "layout/columns";
@import "layout/flex";
@import "layout/grid";
@import "layout/col";
@import "layout/layout";

// ------------------------
@import "components";
// ------------------------
@import "utilities/border";
@import "utilities/margin-padding";
@import "utilities/utilities";
@import "utilities/filter";
@import "utilities/images";
@import "utilities/modal";
@import "utilities/shadow";
@import "utilities/shapes";
@import "utilities/transform";
@import "utilities/width-height";
@import "utilities/background-colors";
@import "utilities/typography";
@import "utilities/alignment";

// ------------------------
@import "debug";

section {
  @include flex-dcia(column, center, center);
  @include py-(60px);
  @include from($md) {
    @include py-(200px);
  }
}

.day-1 {
  @include grid-crjaj(1fr, none, center, center);
  @include from($sm) {
    @include grid-crjaj(1fr 1fr, none, center, center);
  }
  z-index: 5;
  box-shadow: 0px 0px 0px $shadow_color;
  border-radius: $border-radius * 5;
  transition: box-shadow 0.3s;
  // max-width: 700px;

  &:hover .day-1-bg-1,
  &:hover .day-1-bg-2 {
    transform: rotate(0deg) scaleX(1.01) scaleY(1.02);
  }
  &:hover {
    box-shadow: 0px 5px 7px $shadow_color;
  }

  &-bg-1 {
    z-index: -10;
    transform: rotate(7deg) scale(1);
    transition: transform 0.5s;
    opacity: 0.4;
    border-radius: $border-radius * 5;
  }
  &-bg-2 {
    z-index: -10;
    transform: rotate(-7deg) scale(1);
    transition: transform 0.5s;
    opacity: 0.4;
    border-radius: $border-radius * 5;
  }

  & > *:not(div) {
    z-index: 10;
  }
  &-col-2 {
    // @include px-($padding);
    @include p-($padding);
    @include from($sm) {
      @include p-($padding * 3);
      border-top-right-radius: $border-radius * 5;
      border-bottom-right-radius: $border-radius * 5;
    }
    background: rgb(242, 85, 33);
    background: linear-gradient(
      291deg,
      rgba(242, 85, 33, 1) 0%,
      rgba(220, 53, 69, 1) 100%
    );
  }
  &-col-1 {
    @include py-($padding);
    @include from($sm) {
      @include py-($padding * 3);
      border-top-left-radius: $border-radius * 5;
      border-bottom-left-radius: $border-radius * 5;
    }
    background: rgb(242, 85, 33);
    background: linear-gradient(
      291deg,
      rgba(242, 85, 33, 1) 0%,
      rgba(220, 53, 69, 1) 100%
    );
  }
  input {
    background-color: transparent;
    border: none;
    border-bottom: 1px solid Var(light);
    color: Var(light);

    &:focus {
      background-color: transparent;
      outline: none;
      border: none;
      border-bottom: 1px solid Var(light);
    }

    &::placeholder {
      color: transparent;
    }
    &:not(:placeholder-shown) ~ label,
    &:focus ~ label {
      border: none;
      transform: translateY(-100%);
      font-size: $font-size * 0.7;
    }
  }

  &-btn {
    background-color: transparent;
    border: 1px solid Var(light);
    color: Var(light);
    font-size: 1.2rem;
    @include from($sm) {
      @include flex-12(6);
      font-size: 1.5rem;
    }
  }
  label {
    position: absolute;
    top: 0;
    left: 0;
    transition: 0.3s;
    // transform: translateY(-100%);
  }
}

//-----------------------------------------------------*/
.day-2 {
  @include img-container();
  // height: 1000px;

  &-product {
    @include from($md) {
      position: absolute;
      bottom: 0;
      left: 0;
      right: 0;
    }
    color: white;
    background: rgb(2, 0, 36);
    background: linear-gradient(
      0deg,
      rgba(2, 0, 36, 0.748) 0%,
      rgba(33, 33, 178, 0.7111022556709707) 35%,
      rgba(0, 0, 0, 0) 100%
    );
  }

  &-content {
    @include grid-crjaj(1fr, fit-content 1fr, $justify-content: center);
    @include from($md) {
      @include grid-crjaj(1fr 1fr, $justify-content: center);
    }
    // height: 700px;
    transition: grid-template-columns 0.3s;
  }

  &-btn {
    // absolute-outside right bg-danger
    position: absolute;
    top: 0;
    right: 0;
    @include bg-(danger);
    @include t-(light);
    @include from(1040px) {
      top: 0;
      left: 100%;
    }
  }
  &-pay {
    width: 100%;
    @include bg-(success);
    color: Color(light);
  }
}

//-----------------------------------------------------*/
.day-4 {
  @include bg-(info);

  &-col {
    // display: grid;
    // grid-template-columns: repeat(4, 1fr);
    @include grid-crjaj(repeat(4, 1fr), auto, $gap: 0px);
    width: 100%;

    & > span {
      @include p-(3px);

      @include from($sm) {
        font-size: $font-size * 1.5;
        @include p-(10px);
      }
      // border-radius: 4px;
    }
  }

  &-container {
    // display: flex;
    // flex-direction: column;
    box-shadow: 0px 8px 10px -7px $shadow_color;

    @include grid-crjaj(1fr, auto, $gap: 0px);

    @include from($md) {
      grid-template-columns: repeat(2, 1fr);
      // @include flex-dcia(row, $align-items: center, $justify-content: center);
    }
  }

  &-result {
    grid-column: 1 / 1;
    @include from($md) {
      grid-column: 1 / column-line-end;
    }
  }
}

//-----------------------------------------------------*/
.day-6 {
  display: flex;
  flex-wrap: wrap;
  &-sidebar {
    margin-top: -70px;
    flex: 1 1 100%;
    @include from {
      flex: 1 1 30%;
    }
  }
  &-content {
    flex: 1 1 100%;
    @include from {
      margin-top: $padding * 3;
      flex: 1 1 70%;
    }
  }
  .tab {
    border-bottom: 1px solid $gray-light;
    &-active {
      border-bottom: 1px solid $info;
    }
  }
  &-list > * {
    @include my-(8px);
  }
  &-bg {
    background: rgb(255, 252, 155);
    background: linear-gradient(
      161deg,
      rgba(255, 252, 155, 1) 0%,
      rgba(255, 193, 7, 1) 100%
    );
  }
  &-hero {
    &:hover::before {
      opacity: 0.7;
    }
    &::before {
      content: "+";
      color: $black;
      background-color: $white;
      position: absolute;
      top: 50%;
      left: 50%;
      font-size: 2rem;
      // padding: 1px 10px;
      font-weight: bold;
      border-radius: 50%;
      transform: translate(-50%, -50%);
      opacity: 0;
      transition: opacity 0.3s ease;

      width: 30px;
      height: 30px;
      text-align: center;
      line-height: 30px;
    }
  }
}

//-----------------------------------------------------*/
@import url("https://fonts.googleapis.com/css2?family=Kalam:wght@700&display=swap");
.day-7 {
  background: rgba(12, 171, 221, 1);
  background: radial-gradient(
    circle,
    rgb(38, 194, 241) 0%,
    rgb(10, 127, 230) 89%,
    rgba(12, 171, 221, 1) 100%
  );
  border: 3px solid #3eaef8;
  font-family: "Kalam", cursive;

  &-bg {
    background: rgb(12, 107, 221);
    background: linear-gradient(
      324deg,
      rgba(12, 107, 221, 1) 0%,
      hsl(226, 97%, 42%) 100%
    );
    border: 3px solid rgb(34, 10, 193);
  }
  &-1 {
    background: rgb(45, 16, 249);
    background: linear-gradient(
      0deg,
      rgba(45, 16, 249, 1) 0%,
      rgba(198, 157, 255, 1) 100%
    );
    border: 3px solid rgb(34, 10, 193);
    width: 90%;
    padding: $padding;
    @include from($sm) {
      padding: $padding $padding * 2;
      width: 70%;
    }
  }
  &-2 {
    background: rgb(16, 249, 214);
    background: linear-gradient(
      170deg,
      rgb(36, 255, 222) 0%,
      rgb(4, 169, 219) 89%
    );
    color: rgb(31, 82, 249);
    border: 3px solid rgb(34, 10, 193);
    width: 90%;
    padding: $padding;
    @include from($sm) {
      padding: $padding * 2;
      width: 70%;
    }
  }
  &-btn {
    border: 3px solid rgba(249, 16, 16, 1);
    background: rgb(249, 16, 16);
    background: linear-gradient(
      0deg,
      rgba(249, 16, 16, 1) 73%,
      rgba(255, 119, 3, 1) 100%
    );
    width: 170px;
  }
  &-i {
    width: 50px;
    height: 50px;
    background-color: rgb(31, 82, 249);
    border: 3px solid rgb(4, 169, 219);
  }
}

//-----------------------------------------------------*/
.day-8 {
  background: rgb(211, 174, 255);
  background: radial-gradient(
    circle,
    rgba(211, 174, 255, 1) 0%,
    rgba(175, 114, 255, 0) 90%
  );
  @include from() {
    background: radial-gradient(
      circle,
      rgba(211, 174, 255, 1) 0%,
      rgba(175, 114, 255, 0) 75%
    );
  }
  &-btn {
    clip-path: polygon(
      0% 0%,
      calc(var(--width) - 10px) 0%,
      100% 100%,
      10px 100%
    );
  }
}

//-----------------------------------------------------*/

.day-9 {
  &-progress {
    &-container {
      background: Color(gray-light);
      border-radius: 5px;
      cursor: pointer;
      margin: 40px 20px;
      height: 4px;
      width: 90%;
    }
    // background: Color(warning);
    @include bg-(warning);
    border-radius: 5px;
    height: 100%;
    /* change this to show progress */
    width: 0%;
    transition: width 0.1s linear;
  }
  &-duration {
    &-wrapper {
      position: relative;
      top: -25px;
      display: flex;
      justify-content: space-between;
    }
  }
  &-content {
    padding: $padding;
    @include from() {
      padding: $padding * 3;
    }
  }
  &-li {
    border-bottom: 1px solid $gray-light;
    padding: 5px 0;
    cursor: pointer;

    &-active {
      padding: 5px 0;
      border-bottom: 2px solid Color(warning);
      font-weight: bold;
    }
  }
  &-img {
    z-index: 0;
    border-bottom-left-radius: 100px;
    border-bottom-right-radius: 100px;
    width: 70%;
    // @include from($sm) {
    //   width: 70%;
    // }
    // @include from($md) {
    //   width: 30%;
    // }
  }
  &-play {
    top: 0;
    left: 50%;
    transform: translate(-50%, -85%);
    position: relative;
    width: 70%;
    // @include from($sm) {
    //   width: 40%;
    // }
    // @include from($md) {
    //   width: 30%;
    // }

    & .fas {
      // padding: 5px;
      border-radius: 50%;
      // margin: 0 5px;
      position: absolute;
      top: 0;
      left: 50%;
      // transform: translateY(-50%);
      cursor: pointer;
    }

    & .fa-backward {
      top: 50%;
      left: 25%;
      transition: transform 0.2s ease-in-out;
      transform: translate(-50%, -50%);
      &:hover {
        transform: translate(-80%, -50%);
      }
    }
    & .fa-play-circle,
    .fa-pause-circle {
      top: 50%;
      padding: 5px;
      left: 50%;
      transition: transform 0.2s ease-in-out;
      transform: translate(-50%, -50%) scale(1);
      &:hover {
        transform: translate(-50%, -50%) scale(1.2);
      }
    }
    & .fa-forward {
      top: 50%;
      left: 75%;
      transition: transform 0.2s ease-in-out;
      transform: translate(-50%, -50%);
      &:hover {
        transform: translate(-20%, -50%);
      }
    }
  }
}
//-----------------------------------------------------*/
.day-10 {
  @include flex-dcia(column, center, center);
  & > * {
    clip-path: polygon(100% 75%, 50% 100%, 0 75%, 0 0, 50% 25%, 100% 0);
    transition: transform 0.3s ease-in-out, clip-path 0.3s ease-in-out;
    @include to {
      @include flex-dcia(row, center, center);
      margin-top: -11px;
      padding-top: 7px;
      @include square(40px);
    }

    &:hover {
      // clip-path: polygon(50% 0%, 100% 50%, 50% 100%, 0% 50%);
      // clip-path: polygon(50% 0, 100% 50%, 50% 100%, 50% 100%, 0 50%, 50% 0);
