    @include from() {
      @include flex-12(6, $gap: $padding);
      margin-top: 0;
    }
  }
}
//-----------------------------------------------------//
.day-40 {
  @include grid-crjaj(1fr, 1fr 1fr, $gap: $padding * 2);
  @extend .content;
  @include from($md) {
    @include grid-crjaj(1fr 1fr, 1fr, $gap: $padding * 2);
